import { Typography } from "@mui/material";
import Layout from "./components/layout/Layout";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <Routes>
      <Route
        path="/"
        element={
          <Layout header>
            <Typography>asd</Typography>
          </Layout>
        }
      />
    </Routes>
  );
}

export default App;
